function compute_h(u::AbstractVector, t::Real, pODEProblem::AbstractVector, θ_observable::AbstractVector,
                   θ_nonDynamic::AbstractVector, parameterInfo::ParametersInfo, observableId::Symbol, 
                      parameterMap::θObsOrSdParameterMap)::Real 
	if observableId == :PI3K_activity__2B 
		return θ_nonDynamic[1] * u[104] 
	end

	if observableId == :Glucose_uptake__2B 
		return θ_nonDynamic[2] * u[47] 
	end

	if observableId == :Cell_Bound_Ins__2B 
		return θ_nonDynamic[3] * ( u[83] + u[44] + u[52] ) 
	end

	if observableId == :IRSYp__2C 
		return θ_nonDynamic[4] * u[78] 
	end

	if observableId == :PTP_activ__2D 
		return θ_nonDynamic[5] * ( u[84] + u[3] ) 
	end

	if observableId == :Glucose_uptake__3B 
		return θ_nonDynamic[6] * u[47] 
	end

	if observableId == :MnSOD_fold_induction__3C 
		return θ_nonDynamic[7] * u[67] 
	end

	if observableId == :FOXO4__3C 
		return θ_nonDynamic[8] * ( ( u[12] + u[15] + u[53] + u[82] + u[70] + u[72] + u[100] + u[62] + u[46] + u[85] + u[23] + u[64] + u[33] + u[76] + u[54] + u[65] )  +  ( u[66] + u[74] + u[90] + u[61] + u[86] + u[58] + u[71] + u[1] + u[30] + u[13] + u[48] + u[57] + u[108] + u[97] + u[38] + u[43] )  +  ( u[60] + u[39] + u[88] + u[27] + u[5] + u[98] + u[18] + u[29] + u[107] + u[2] + u[31] + u[81] + u[59] + u[99] + u[28] + u[92] ) ) 
	end

end

